import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { TextField } from './components/TextFields';

ReactDOM.render(
  <React.StrictMode>
    <App />
    <TextField />
  </React.StrictMode>,
  document.getElementById('root'),
);

